- input: "TEXT\x1CC00389288\x1C1\x1C\x1CF3XN\x1CDuring the course of a recent audit,
    it was discovered that our previous compliance vendor was reporting payroll deductions
    on the date the funds were being deposited into the PAC bank account instead of
    the actual payroll date.  This caused payrolls to be reported anywhere from a
    few days to a week after the correct date and the last payroll of the year to
    be reported in January of the following year.  This practice dates back prior
    to 2008 and thus crosses multiple election cycles.  In July of 2013, we contracted
    with a new compliance vendor who then began reporting payroll deductions on the
    \ actual payroll date instead of the date of deposit.  As a result, this report
    reflects 25 payroll deduction dates when in actuality there were only 24.  This
    has caused 20 of our donors to appear to have made excessive contributions for
    the 2013 calendar year when in fact none of these are excessive.\n"
